            new Vivus('canvas', {

                    },
                    function (obj) {

                        setTimeout(hide,3000);
                        setTimeout(show,3000);
                        setTimeout(canvas_2,3000);
                    }
            );
        }
        canvas_1();

        function show(){
            $('#canvas-2').show()
        }


        function canvas_2 (){
            new Vivus('canvas-2', {
                        start: 'autostart',
                        type: 'delayed',
                        duration: 200
                    },

                    function (obj) {

                    }
            );
        }


        function hide(){
            $('#canvas').hide()
        }



    })
